import styled from "vue-styled-components";

const StyleSignIn = styled`
    margin: 15px 14px 17px 0;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 600;
    font-size: 16px;
    line-height: 24px;
    color: #173A56;
    border: #BCD0E5 1px solid;
    border-radius: 5px;
    padding: 0;
    background-color: #FFF;
    height: 46px;
    width: 102px;`;

export default StyleSignIn
